import React from 'react'
import { Link } from 'react-router-dom'
const Navbar = () => {
  return (
    <div>
      <div className="nav-links flex mx-auto">
        <nav className="flex sm:justify-center space-x-4">
            {[
              ['Home', '/dashboard'],
              ['Team', '/team'],
              ['Projects', '/projects'],
              ['Reports', '/reports'],
            ].map(([title, url]) => (
              <li className="rounded-lg px-3 py-2 text-slate-700 font-medium hover:bg-slate-100 hover:text-slate-900">
                <Link to={url} >{title}</Link>
              </li>

          ))}
        </nav>
      </div>
    </div>
  )
}

export default Navbar
